import React from "react";

const Deletereport = ({ showModal, handleClose, TaskID }) => {
  const handleDeleteReport = async () => {};
  const onClose = async () => {
    handleClose();
  };
  return (
    <div
      className={`modal fade ${showModal ? "show" : ""}`}
      style={{ display: showModal ? "block" : "none" }}
      data-bs-theme="dark"
    >
      <div
        className="modal-dialog modal-xl text-white text-center"
        role="document"
      >
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">
              <i className="fa fa-file fa-fw me-2"></i>Delete Report
            </h5>
            <button
              type="button"
              className="btn-close"
              aria-label="Close"
              onClick={onClose}
            ></button>
          </div>
          <div className="modal-body text-start">
            {/* Text Input Section */}
            <div className="mb-3">
              <label htmlFor="textInput" className="form-label">
                Text Report:
              </label>
              <textarea
                id="textInput"
                placeholder="Description"
                className="form-control"
                value={textInput}
                onChange={handleTextChange}
              />
            </div>

            {/* File Upload Section */}
            <div className="mb-3">
              <label htmlFor="fileInput" className="form-label">
                Upload Files:
              </label>
              <div className="input-group">
                <button
                  className="btn btn-secondary"
                  type="button"
                  onClick={() => fileInputRef.current.click()}
                >
                  <i className="fa fa-file fa-fw "></i> Browse
                </button>
                <input
                  type="file"
                  id="fileInput"
                  multiple
                  className="form-control visually-hidden"
                  onChange={handleFileChange}
                  ref={fileInputRef}
                />
                <label
                  className="input-group-text flex-grow-1"
                  htmlFor="fileInput"
                >
                  {files.length > 0
                    ? files.length === 1
                      ? files[0].name
                      : `${files.length} Files Selected`
                    : "No File Chosen"}
                </label>
              </div>
            </div>

            {/* Preview Section */}
            <div>
              {files.map((file, index) => (
                <div key={index}>
                  <div className="input-group mb-3">
                    <button
                      type="button"
                      className="btn btn-danger btn-sm "
                      onClick={() => handleRemoveFile(index)}
                    >
                      <i className="fa fa-remove fa-fw" aria-hidden="true"></i>{" "}
                      Remove
                    </button>
                    <span className="form-control">{file.name}</span>
                  </div>

                  {file.type.startsWith("image/") && (
                    <img
                      className="mb-3"
                      src={URL.createObjectURL(file)}
                      alt={file.name}
                      style={{ maxWidth: "100%" }}
                    />
                  )}
                  {file.type === "application/pdf" && (
                    <embed
                      className="mb-3"
                      src={URL.createObjectURL(file)}
                      type="application/pdf"
                      style={{ width: "100%", height: "calc(100vw / 1.414)" }}
                    />
                  )}
                </div>
              ))}
            </div>
            {errorMessage ? (
              <div className="alert alert-danger mt-3" role="alert">
                {errorMessage}
              </div>
            ) : successMessage ? (
              <div className="alert alert-success mt-3" role="alert">
                {successMessage}
              </div>
            ) : null}
          </div>
          <div className="modal-footer">
            <button
              type="button"
              className="btn btn-secondary"
              onClick={onClose}
            >
              Cancel
            </button>
            <button
              type="button"
              className="btn btn-primary"
              onClick={handleDeleteReport}
            >
              Submit
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Deletereport;
